import { Box, Typography } from "@mui/material";

export default function Tours({tours}) {
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        width: "100vw",
        height: "100vh",
      }}
    >
      <Typography variant="h2" fontWeight="bold" sx={{color: "red", display: "inline", textDecoration: "underline wavy cyan 10"}}>
        <Typography variant="h2" sx={{color: "C00E53", display: "inline", textDecoration: "underline #C00E53"}}>
            Our Tours
        </Typography>
      </Typography>
    </Box>
  );
}
